import React from 'react' ;

export class Table extends React.Component {
    render() {
        return (
            <div>
                <table style={{border : '1px solid black'}}>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>E-mail</th>
                        <th>Address</th>
                    </tr>
                </table>
            </div>
        );
    }
}
